async function lockedProfile() {
     
    let baseUrl = `http://localhost:3030/jsonstore/advanced/profiles`;
    let mainSite = document.getElementById('main');

    mainSite.innerHTML = '';

        try {
            let response = await fetch(baseUrl);
            let profileData = await response.json();
            let profiles = Object.values(profileData);
            
            for (let profile of profiles) {
                let username = profile.username;
                let email = profile.email;
                let age = profile.age;
                let idx = profiles.indexOf(profile) + 1;

                let profileCard = createProfileCard(username, email, age, idx);
                mainSite.appendChild(profileCard);
            }

        } catch (error) {
            console.error(error);
        }
        
    function createProfileCard(username, email, age, userIndex) {
        let profileCard = document.createElement('div');
        profileCard.classList.add('profile');
    
        let img = document.createElement('img');
        img.src = './iconProfile2.png';
        img.classList.add('userIcon');
    
        let lockLabel = document.createElement('label');
        lockLabel.textContent = 'Lock';
    
        let lockRadio = document.createElement('input');
        lockRadio.type = 'radio';
        lockRadio.name = `user${userIndex}Locked`;
        lockRadio.value = 'lock';
        lockRadio.checked = true;
    
        let unlockLabel = document.createElement('label');
        unlockLabel.textContent = 'Unlock';
    
        let unlockRadio = document.createElement('input');
        unlockRadio.type = 'radio';
        unlockRadio.name = `user${userIndex}Locked`;
        unlockRadio.value = 'unlock';
    
        let br = document.createElement('br');
        let hr1 = document.createElement('hr');
    
        let usernameLabel = document.createElement('label');
        usernameLabel.textContent = 'Username';
    
        let usernameInput = document.createElement('input');
        usernameInput.type = 'text';
        usernameInput.name = `user${userIndex}Username`;
        usernameInput.value = username;
        usernameInput.disabled = true;
        usernameInput.readOnly = true;
    
        let hiddenDiv = document.createElement('div');
        hiddenDiv.classList.add(`user${userIndex}Username`);
        hiddenDiv.style.display = 'none';
    
        let hr2 = document.createElement('hr');
    
        let emailLabel = document.createElement('label');
        emailLabel.textContent = 'Email:';
    
        let emailInput = document.createElement('input');
        emailInput.type = 'email';
        emailInput.name = `user${userIndex}Email`;
        emailInput.value = email;
        emailInput.disabled = true;
        emailInput.readOnly = true;
    
        let ageLabel = document.createElement('label');
        ageLabel.textContent = 'Age:';
    
        let ageInput = document.createElement('input');
        ageInput.type = 'number';
        ageInput.name = `user${userIndex}Age`;
        ageInput.value = age;
        ageInput.disabled = true;
        ageInput.readOnly = true;
    
        hiddenDiv.appendChild(hr2);
        hiddenDiv.appendChild(emailLabel);
        hiddenDiv.appendChild(emailInput);
        hiddenDiv.appendChild(ageLabel);
        hiddenDiv.appendChild(ageInput);
    
        let showMoreBtn = document.createElement('button');
        showMoreBtn.textContent = 'Show more';
    
        showMoreBtn.addEventListener('click', showMore);
    
        profileCard.appendChild(img);
        profileCard.appendChild(lockLabel);
        profileCard.appendChild(lockRadio);
        profileCard.appendChild(unlockLabel);
        profileCard.appendChild(unlockRadio);
        profileCard.appendChild(br);
        profileCard.appendChild(hr1);
        profileCard.appendChild(usernameLabel);
        profileCard.appendChild(usernameInput);
        profileCard.appendChild(hiddenDiv);
        profileCard.appendChild(showMoreBtn);
    
        return profileCard;
    }
    
    function showMore (event) {
        let button = event.currentTarget;
        let currentProfile = event.currentTarget.parentElement;
        let currentProfileHidden = currentProfile.querySelector('div:last-of-type');
        let currentProfileLock = currentProfile.querySelector('input[type="radio"][value="lock"]');
        let isLocked = currentProfileLock.checked;

        if (button.textContent === 'Show more') {
            
            if(!isLocked) {
                button.textContent = 'Hide it';
                currentProfileHidden.style.display = 'block';
            }
        } else {
            button.textContent = 'Show more';
            currentProfileHidden.style.display = 'none';
        }
    }
}

function students () {
    let submitBtn = document.getElementById('submit');
    let baseUrl = `http://localhost:3030/jsonstore/collections/students`;
    let tableBody = document.querySelector('#results tbody');

    submitBtn.addEventListener('click', function (e) {
        e.preventDefault;
        addStudent();
    })

    loadStudents();
    
    async function addStudent () {
        let firstName = document.getElementsByName('firstName')[0].value;
        let lastName = document.getElementsByName('lastName')[0].value;
        let facultyNumber = document.getElementsByName('facultyNumber')[0].value;
        let grade = document.getElementsByName('grade')[0].value;

        let newStudent = {
            firstName: firstName,
            lastName: lastName,
            facultyNumber: facultyNumber,
            grade: grade,
        }

        if (!firstName || !lastName || !facultyNumber || !grade) {
            return;
        }

        try {
            await fetch (baseUrl, {
                method: 'post',
                headers: { 'Content-type': 'application/json' },
                body: JSON.stringify(newStudent),
        })

        loadStudents();

        } catch (error) {
            console.error(error);
        }
    }

    async function loadStudents () {
        try {
            let response = await fetch(baseUrl);
            let studentData = await response.json();

            let students = Object.values(studentData);

            for (let student of students) {
                let newRow = document.createElement('tr');
                
                let firstNameCell = document.createElement('td');
                firstNameCell.textContent = student.firstName;
                newRow.appendChild(firstNameCell);

                let lastNameCell = document.createElement('td');
                lastNameCell.textContent = student.lastName;
                newRow.appendChild(lastNameCell);
                
                let facultyNumberCell = document.createElement('td');
                facultyNumberCell.textContent = student.facultyNumber;
                newRow.appendChild(facultyNumberCell);

                let gradeCell = document.createElement('td');
                gradeCell.textContent = student.grade;
                newRow.appendChild(gradeCell);

                tableBody.appendChild(newRow);
            }

        } catch (error) {
            console.error(error);
        }

    }
}

students();

function attachEvents() {
    let baseURL = `http://localhost:3030/jsonstore/phonebook`;
    let loadBtn = document.getElementById('btnLoad');
    let addBtn = document.getElementById('btnCreate');
    let phoneBook = document.getElementById('phonebook');

    loadBtn.addEventListener('click', loadPhones);
    addBtn.addEventListener('click', addPhone);

    async function loadPhones () {
        try {
            let response = await fetch(baseURL);
            let phoneData = await response.json();
            let phoneNumbers = Object.values(phoneData);

            phoneBook.replaceChildren();

            for (let entry of phoneNumbers) {
                let liItem = document.createElement('li');
                let deleteBtn = document.createElement('button');
                deleteBtn.textContent = 'Delete';
                deleteBtn.dataset.id = entry._id;
                deleteBtn.addEventListener('click', deletePhone);
                liItem.append(`${entry.person}: ${entry.phone}`);
                liItem.appendChild(deleteBtn);
                
                phoneBook.appendChild(liItem);
            }
        } catch (error) {
            console.error(error);
        }
    }

    async function deletePhone (event) {
        const id = event.target.dataset.id;

        try {
            await fetch(`${baseURL}/${id}`, {
                method: 'DELETE'
            });

            loadPhones();
        } catch (error) {
            console.error('Failed to delete:', error);
        }
    }
    

    async function addPhone () {
        let newPerson = document.getElementById('person').value;
        let newPhone = document.getElementById('phone').value;

        if (!newPerson || !newPhone) {
            document.getElementById('person').value = '';
            document.getElementById('phone').value = '';
            return;
        }

        let newEntry = {
            person: newPerson,
            phone: newPhone,
        };

        newEntry = JSON.stringify(newEntry);

        await fetch(baseURL, {
            method: 'post',
            headers: { 'Content-type': 'application/json' },
            body: newEntry,
        });

        document.getElementById('person').value = '';
        document.getElementById('phone').value = '';

        loadPhones();
    }
}

attachEvents();

function attachEvents() {
    let messageUrl = `http://localhost:3030/jsonstore/messenger`;
    let sendBtn = document.getElementById('submit');
    let refreshBtn = document.getElementById('refresh');
    let messageScreen = document.getElementById('messages');

    sendBtn.addEventListener('click', addMsg);
    refreshBtn.addEventListener('click', displayMsg);

    async function addMsg () {
        let authorName = document.getElementsByName('author')[0].value;
        let msgText = document.getElementsByName('content')[0].value;

        if (!authorName || !msgText) {
            return;
        }

        let newMsg = {
            author: authorName,
            content: msgText,
        }

        try {
            await fetch(messageUrl, {
                method: 'post',
                headers: { 'Content-type': 'application/json' },
                body: JSON.stringify(newMsg),
                })
        } catch (error) {
            console.error(error);
        }
    }

    async function displayMsg () {
        try {
            let response = await fetch(messageUrl);
            let messages = await response.json();
            messageScreen.textContent = ''
            let result = [];

            let messageValues = Object.values(messages);

            for (let message of messageValues) {
                let currentStr = `${message.author}: ${message.content}`;
                result.push(currentStr);
            }

            messageScreen.textContent = result.join('\n');
        } catch (error) {
            console.error(error);
        }
    } 
}

attachEvents();

function attachEvents() {
    let postsUrl = 'http://localhost:3030/jsonstore/blog/posts';
    let commentsUrl = 'http://localhost:3030/jsonstore/blog/comments';

    let loadBtn = document.getElementById('btnLoadPosts');
    let viewBtn = document.getElementById('btnViewPost');

    let selectSection = document.getElementById('posts');
    let postTitle = document.getElementById('post-title');
    let postBody = document.getElementById('post-body');
    let list = document.getElementById('post-comments');

    loadBtn.addEventListener('click', loadPosts);
    viewBtn.addEventListener('click', loadComments);

    async function loadPosts () {
        try {
            let posts = await fetch(postsUrl);
            let postData = await posts.json();

            let postEntries = Object.entries(postData);

            for (let [key, post] of postEntries) {
                let newOption = document.createElement('option');
                newOption.value = key;
                newOption.textContent = post.title;

                selectSection.appendChild(newOption);
            }

        } catch (error) {
            console.error(error);
        }
    }

    async function loadComments () {
        let currentKey = selectSection.value;
        let currentPost;

        try {
            let posts = await fetch(postsUrl);
            let postData = await posts.json();

            let currentPost = postData[currentKey];

            postTitle.textContent = currentPost.title;
            postBody.textContent = currentPost.body;

        } catch (error) {
            console.error(error);
        }

        try {
            let comments = await fetch(commentsUrl);
            let commentsData = await comments.json();
            list.innerHTML = '';
            
            let filteredComments = Object.values(commentsData).filter(c => c.postId === currentKey);

            filteredComments.forEach(comment => {
                const li = document.createElement('li');
                li.textContent = comment.text;
                list.appendChild(li);
            });

        } catch (error) {
            console.log(error);
        }
    }

}

attachEvents();

